import data from "./Todo.json"
import Search from "./Search";
import List from "./List";


const SearchableList = () => {

    const[q, setQ] = useState("");

    return (
        <>
        <Search query={q} queryFunction={setQ} />
        <List list={data}/>
        </>
    )


}

export default SearchableList;
